        return (
            <div>
            <title>main</title>
            <link rel="stylesheet" href="style.css" />
            <header>
              <figure>
                <img src="images/logo.png" alt="logo" />
              </figure>
            </header>
            <section>
              <input type="text" className="search_content" />
              <button>Search</button>
              <input type="radio" className="selector" name="choice" defaultValue="movies name" />movie
              <input type="radio" className="selector" name="choice" defaultValue="review" />review
              {/* <input type="radio" class='selector' name="choice" value="movies name" >movie<br>
            <input type="radio"class='selector' name="choice" value="review" >review<br>   */}
            </section>  
            <footer>
              <p>
                TTDS CW3
              </p>
            </footer>
          </div>
        );
    }
}

export default MainPage;
